import React from "react";

function Result({ result, error }) {
  return (
    <div className="mt-6 text-center">
      {result && (
        <div className="p-4 bg-green-100 text-green-700 rounded-md">
          <h3 className="text-xl font-semibold">
            Predicted Insurance Premium: ₹ {result.toFixed(2)}
          </h3>
        </div>
      )}

      {error && (
        <div className="p-4 bg-red-100 text-red-600 rounded-md">
          <p>Error: {error}</p>
        </div>
      )}

      {!result && !error && (
        <div className="p-4 bg-gray-100 text-gray-500 rounded-md">
          <p>Enter details and click “Predict” to see result.</p>
        </div>
      )}
    </div>
  );
}

export default Result;
